<script>
	import personajeComponent from '../PerfilUser/personaje';
    export default {
        name:"preview-perfiluser",
        props:["perfil"],
        components : {
        	personajeComponent
        },
        data() {
            return {
                idiomas: [],
            }
        },
        mounted () {
            this.perfil.planes.forEach(plan => {
                if (this.idiomas.some(evt => evt.id===plan.plan.membresia.idioma.id)!=true) {
                    this.idiomas.push(plan.plan.membresia.idioma);
                }               
            });
        },
    }
</script>

